import React from "react";
import './sponsors.css';
import Button from '@mui/material/Button'

class Sponsors extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isModalVisible: 0 //the modal is not visible
        }
    }

    openModal() {
        this.setState(
            { isModalVisible: 1 }
        )
        console.log("modal opened");
    }

    closeModal() {
        this.setState(
            { isModalVisible: 1 }
        );
        document.removeEventListener("click", this.closeModal)
    }
    render() {
        return (
            <div className="sponsors__main-container">
                <h1 className="sponsors__title">COLABORATORI</h1>
                <div className="sponsors__buttons">
                    <Button className="sponsors__button" onClick={this.openModal()}> La Butoaie</Button>
                    <Button className="sponsors__button">Cofetaria Riviana</Button>
                </div>
            </div>
        );
    }
}

export default Sponsors;
